import React from "react";

function Clock() {

  const hours = new Date().getHours();
  console.log(hours);
  console.log(hours);

  switch(hours) {
    case hours < 12:
      return <main>Good Morning!</main>;
    case 12 < hours && hours < 18:
      return <main>Good Afternoon!</main>;
    case hours > 18:
      return <main>Good Evening!</main>;
    default:
      return <main>Not a valid time</main>
  }
}

export default Clock;
